description:
docopt.net is the .net version of the docopt python beautiful command line parser.  docopt.net helps you define an interface for your command-line app, and automatically generate a parser for it. docopt.net is based on conventions that have been used for decades in help messages and man pages for program interface description.  Interface description in docopt.net is such a help message, but formalized. Check out http://docopt.org for a more detailed explanation.

Quick example:  
   var arguments = new Docopt().Apply("Usage: prog [-a] [-b] FILE", args);
   if (arguments["-a"].IsTrue) { ... }

A tiny C# class to handle arguments sent to a console application.
Tiny uses the power of dynamic and ExpandoObject in .Net 4 to dynamically populate name-value pairs from the arguments passed to the command line.
The inspiration from Tiny came from Rob Conery's Micro-Orm project - Massive, where he used the power of dynamic to display some really cool magic.
Tiny's argument parsing depends on separators for name-value pairs, for example if the command line for your app is:
c:\code\myapp\bin\myapp testargument1:testvalue testargument2:with_a:in_the_value testargument3
Note: The default separator for Tiny is ':'.
The code for parsing these arguments through Tiny is:
static void Main(string[] args) {
 Tiny t = new Tiny(args); 
}
You can read the passed arguments directly as properties via your code by writing code like this:
t.Arguments.testargument1;
t.Arguments.testargument2;
Any argument without a specified separator gets the name of UndefinedArgumentX where X is the number of the encountered argument without a separator.
In the above example, the last argument can be read via:
t.Arguments.UndefinedArgument1;

Usage in controller:
AngularTemplateHelper.RenderAngularTemplates(Server.MapPath("~/app"));

Usage in MVC View:
@Html.Raw(AngularTemplateHelper.RenderAngularTemplates(Server.MapPath("~/app")));



Output:
<script type=\"text/ng-template\" id=\"/app/subfolder1/test2.html\">body2htmlstring</script>

<script type=\"text/ng-template\" id=\"/app/subfolder1/test3.html\"><span>testbody3</span></script>

Note:
Need to use @Html.Raw helper if your calling it in a view, as the assembly deliberately avoids taking any dependencies on System.Web or Mvc. You could easily wrap this as a HtmlHelper extension or similar.

Nemiro.Convertion is small helper class for converting a data types to another data types in .NET Framework.

Features

* Safe conversion the DBNull, NULL and empty values; 
* Processing floating-point numbers, regardless of the type of decimal separator (dot or comma); 
* Number system conversion: hexadecimal, hexatrigesimal, duosexagesimal, etc.; 
* Easy to specify the date format for converting; 
* Using the default values for zero incoming values.

Archiver for WinRT is a powerful utility for compressing and decompressing files and folders. Up until now, managing compressed files has been a huge pain in WinRT and Windows 8. Moreover, using the built-in mechanism, you couldn't compress a folder with its subfolders and files.

Archiver makes compressing and decompressing amazingly easy, using just two lines of code:

Archiver archiver = new Archiver();
archiver.Compress(source, destination);

... where source and destination are the specified files and folders.

